from befree.api_model.config.headers import Headersfrom befree.api_model.catalog.private.attributes.endpoints import Endpointsfrom befree.api_model import apifrom requests import Responseclass Attributes:    def __init__(self):        self._endpoints = Endpoints()        self._headers = Headers()    def get(self, category_id=""):        response: Response = api.private_session.get(            url=self._endpoints.get(category_id=category_id)        )        return response    def get_values(self, attribute_id, compilation_id=""):        response: Response = api.private_session.get(            url=self._endpoints.get_values(compilation_id=compilation_id, attribute_id=attribute_id)        )        return response